arStrings.szText:
{c_label}每秒攻击次数: {c_number}{s1}{/c}{/c}
{icon:bullet}基于武器攻速。
{icon:bullet}可通过技能或物品提升。

{c_label}暴击几率: {c_number}{s1}{/c}{/c}
{icon:bullet}暴击可额外造成{c_number}{s2}{/c}伤害。
{icon:bullet}可通过技能或物品提升。

{c_label}护盾格挡值: {c_number}{s1}{/c}{/c}
{icon:bullet}格挡攻击时所阻挡的伤害量。
{icon:bullet}护盾格挡值可通过技能或物品提升。

{c_label}生命上限: {c_number}{s2}{/c}{/c}
{icon:bullet}如果你损失了所有生命，你会死亡。
{icon:bullet}生命可通过技能或物品提升。

{c_label}消灭回复生命: {c_number}{s1}{/c}{/c}
{icon:bullet}你每消灭一个敌人即会回复{c_number}{s2}{/c}点生命。
{icon:bullet}消灭回复生命可通过技能或物品提升。

{c_label}击中回复生命: {c_number}{s1}{/c}{/c}
{icon:bullet}你每击中一个敌人即会回复{c_number}{s2}{/c}点生命。
{icon:bullet}击中回复生命可通过技能或物品提升。

{c_label}暴击伤害加成: {/c}{c_number}{s1}{/c}
{icon:bullet}可通过技能或物品提升。
{icon:bullet}对其他玩家最高不超过{c_number}{s2}{/c}。

{c_label}移动速度: {/c}{c_number}{s1}{/c}
{icon:bullet}你的基础移动速度是{c_number}{s2}{/c}。
{icon:bullet}你最多可以从物品中获得{c_number}+25.00%{/c}的移动速度。

{c_label}经验值加成: {c_number}{s1}{/c}{/c}
{icon:bullet}消灭怪物获得的经验值提高{c_number}{s2}{/c}。
{icon:bullet}增倍: {c_number}{s3}x{/c}。增倍效果在多人游戏中生效。

{c_label}荆棘: {/c}{c_number}{s1}{/c}
{icon:bullet}受到直接攻击时对攻击者造成伤害。持续性伤害不会触发这一效果。
{icon:bullet}你的主属性部分数值可以提高造成的伤害。

{c_label}生命上限: {c_number}{s2}{/c}{/c}
{icon:bullet}如果追随者失去全部生命，他们将在短时间内丧失行动能力。
{icon:bullet}生命可通过技能或物品提升。

{c_label}生命上限: {c_number}{s2}{/c}{/c}
{icon:bullet}如果追随者失去全部生命，他们将在短时间内丧失行动能力。
{icon:bullet}生命可通过技能或物品提升。

{c_label}生命上限: {c_number}{s2}{/c}{/c}
{icon:bullet}如果追随者失去全部生命，他们将在短时间内丧失行动能力。
{icon:bullet}生命可通过技能或物品提升。

{c_label}范围伤害: {/c}{c_number}{s1}{/c}
{icon:bullet}所有攻击有{c_number}{s2}{/c}的几率还会对{c_number}{s4}{/c}码范围内的所有敌人造成伤害，数值相当于该伤害的{c_number}{s3}{/c}。
{icon:bullet}物品可以提高造成的伤害。

{c_label}{s1}伤害加成: {/c}{c_number}{s2}{/c}
{icon:bullet}提高此类元素技能所造成的伤害。
{icon:bullet}{s3}伤害: {c_number}{s4}{/c}。

{c_label}意力: {/c}{c_number}{s1}{/c}{c_lightgray} (物品贡献: {c_blue}{s4}{/c}){/c}{s2}
{icon:bullet}受到的治疗提高{c_number}{s3}{/c}
{icon:bullet}{c_important}{u}压制{/u}{/c_important}伤害提高{c_number}{s5}{/c}

{c_label}每次消灭获得伤害屏障: {c_number}{s1}{/c}{/c}
{icon:bullet}在消灭敌人时获得一个伤害屏障。
{icon:bullet}物品可增加屏障吸收值。

{c_label}药水冷却时间缩短: {c_number}{s1}{/c}{/c}
{icon:bullet}缩短药水的冷却时间。
{icon:bullet}物品可以进一步缩短冷却时间。

{c_label}压制几率: {/c}{c_number}{s1}{/c}
{icon:bullet}压制会基于你当前生命与被强固的生命的总合造成额外伤害。
{icon:bullet}持续伤害、被动技能及引导技能不会造成压制伤害。
